import React from 'react';

const Contact = () => {
  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle form submission logic here
  };

  const formStyle = {
    border:"400px",
    backgroundColor:"yellow",
    display: 'flex',
    flexDirection: 'column',
    maxWidth: '400px',
    margin: 'auto',
  };

  const inputStyle = {
    margin: '5px 0',
    padding: '8px',
    borderRadius: '4px',
    border: '1px solid #ccc',
    fontSize: '16px',
  };

  const buttonStyle = {
    margin: '10px 0',
    padding: '8px 16px',
    borderRadius: '4px',
    border: 'none',
    backgroundColor: '#007bff',
    color: '#fff',
    fontSize: '16px',
    cursor: 'pointer',
  };

  return (
    <div className="contact-container">
      <h2>Contact Us</h2>
      <form className="contact-form" style={formStyle} onSubmit={handleSubmit}>
        <label htmlFor="name">Name:</label>
        <input type="text" id="name" name="name" style={inputStyle} />

        <label htmlFor="email">Email:</label>
        <input type="email" id="email" name="email" style={inputStyle} />

        <label htmlFor="message">Message:</label>
        <textarea id="message" name="message" rows="4" style={inputStyle} />

        <button type="submit" style={buttonStyle}>Submit</button>
      </form>
    </div>
  );
};

export default Contact;
